import React from "react";
import sofaGreenMaria from "../images/sofaGreenMaria.PNG";
import chairStreetMaria from "../images/chairStreetMaria.PNG";
import sofaOwlMaria from "../images/sofaOwlMaria.PNG";
import index from "../stylesheets/index.css";

function Index() {
  return (
    <div
      class="bg_image"
      style={{
        backgroundImage: `url(${sofaGreenMaria})`,
        backgroundSize: "cover",
        height: "100vh",
      }}
    >
      <b>
        <a
          href="/recommendations"
          style={{ fontSize: "1.4rem", margin: "60px" }}
        >
          Recommendations
        </a>
      </b>
      <a href="/soundtracks">Soundtracks For Sofas</a>
      <a href="/aboutproject" style={{ fontSize: "2rem" }}>
        The Sofa Project
      </a>
      <a href="/theworldaroundsofa" style={{ fontSize: "1.2rem" }}>
        The World Around Sofa
      </a>
      <a href="/cello">Cello</a>
      <b>
        <a href="/aboutartist" style={{ fontSize: "1.2rem" }}>
          About The Artist
        </a>
      </b>
    </div>
  );
}

export default Index;
